_CrewPage.default.crewCard.name.then(function ($el) {
  var searchName = $el[$el.length - 1].innerText;
  var nameParts = searchName.split(' ');
  nameParts.forEach(function (partText) {
    _CrewPage.default.filters.useFilter({
      name: partText
    });
    _CrewPage.default.crewCard.name.each(function (name) {
      expect(name.text()).to.contain(partText);
    });
    _CrewPage.default.filters.nameInput.clear();
  });
});

_CrewPage.default.crewCard.city.then(function ($el) {
  var searchCity = $el[$el.length - 1].innerText;
  var nameParts = searchCity.split(' ');
  nameParts.forEach(function (partText) {
    _CrewPage.default.filters.useFilter({
      city: partText
    });
    _CrewPage.default.crewCard.city.each(function (name) {
      expect(name.text()).to.contain(partText);
    });
    _CrewPage.default.filters.cityInput.clear();
  });
});

_CrewPage.default.crewCard.name.then(function ($name) {
  var searchName = $name[$name.length - 1].innerText.substring(0, 3);
  _CrewPage.default.crewCard.city.then(function ($city) {
    var searchCity = $city[$city.length - 1].innerText.substring(0, 3);
    _CrewPage.default.filters.useFilter({
      name: searchName,
      city: searchCity
    });
    _CrewPage.default.crewCard.name.each(function (name) {
      expect(name.text()).to.contain(searchName);
    });
    _CrewPage.default.crewCard.city.each(function (city) {
      expect(city.text()).to.contain(searchCity);
    });
  });
});
